import React, { useState } from "react";
import Map, { NavigationControl, Marker, Popup } from "react-map-gl";
import Navbar from "./components/navbar.js";
import maplibregl from "maplibre-gl";
import "maplibre-gl/dist/maplibre-gl.css";
import "./App.css";
import defaultImage from "./macos-monterey-stock-green-dark-mode-layers-5k-6016x6016-5888.jpg"; // Import a default image for the popup

function App() {
  const [defaultPopup1, setDefaultPopup1] = useState(true); // Set the defaultPopup state for the first popup
  const [defaultPopup2, setDefaultPopup2] = useState(true); // Set the defaultPopup state for the second popup
  const [defaultPopup3, setDefaultPopup3] = useState(true); // Set the defaultPopup state for the third popup
  const [defaultPopup4, setDefaultPopup4] = useState(true); // Set the defaultPopup state for the fourth popup
  const [defaultPopup5, setDefaultPopup5] = useState(true); // Set the defaultPopup state for the fifth popup
  const [selectedPlace, setSelectedPlace] = useState(null);

  const handleMapClick = (event) => {
    // Check if any default popup is open and if the click event doesn't target any default popup
    if (
      (defaultPopup1 ||
        defaultPopup2 ||
        defaultPopup3 ||
        defaultPopup4 ||
        defaultPopup5) &&
      event.target.className !== "mapboxgl-popup-content"
    ) {
      setDefaultPopup1(false); // Close the first default popup
      setDefaultPopup2(false); // Close the second default popup
      setDefaultPopup3(false); // Close the third default popup
      setDefaultPopup4(false); // Close the fourth default popup
      setDefaultPopup5(false); // Close the fifth default popup
    }
    setSelectedPlace(null); // Close any other selected popup
  };

  return (
    <div className="App">
      <Navbar />
      <Map
        mapLib={maplibregl}
        initialViewState={{
          longitude: 77.48918219999996,
          latitude: 10.2381136,
          zoom: 14,
        }}
        style={{ width: "100%", height: " calc(100vh - 77px)" }}
        mapStyle="https://api.maptiler.com/maps/streets/style.json?key=KpFr32C3asC9l9tm2vNd"
        onClick={handleMapClick} // Close popups on map click
      >
        <NavigationControl position="top-left" />

        {/* First custom marker with black color */}
        <Marker longitude={77.48918219999996} latitude={10.2381136}>
          <div
            className="marker"
            style={{
              backgroundColor: "black",
              width: "20px",
              height: "20px",
              borderRadius: "50%",
            }}
          />
        </Marker>
        {/* First default popup */}
        {defaultPopup1 && (
          <Popup
            longitude={77.48918219999996}
            latitude={10.2381136}
            onClose={() => setDefaultPopup1(false)}
          >
            <div>
              <img
                src={defaultImage}
                alt="Default Place 1"
                style={{ width: "200px", height: "150px" }}
              />
              <p>Description of the place 1</p>
            </div>
          </Popup>
        )}

        {/* Second custom marker with black color */}
        <Marker longitude={79.48918219999996} latitude={11.2381136}>
          <div
            className="marker"
            style={{
              backgroundColor: "black",
              width: "20px",
              height: "20px",
              borderRadius: "50%",
            }}
          />
        </Marker>
        {/* Second default popup */}
        {defaultPopup2 && (
          <Popup
            longitude={79.48918219999996}
            latitude={11.2381136}
            onClose={() => setDefaultPopup2(false)}
          >
            <div>
              <img
                src={defaultImage}
                alt="Default Place 2"
                style={{ width: "200px", height: "150px" }}
              />
              <p>Description of the place 2</p>
            </div>
          </Popup>
        )}

        {/* Third custom marker with black color */}
        <Marker longitude={76.48918219999996} latitude={9.2381136}>
          <div
            className="marker"
            style={{
              backgroundColor: "black",
              width: "20px",
              height: "20px",
              borderRadius: "50%",
            }}
          />
        </Marker>
        {/* Third default popup */}
        {defaultPopup3 && (
          <Popup
            longitude={76.48918219999996}
            latitude={9.2381136}
            onClose={() => setDefaultPopup3(false)}
          >
            <div>
              <img
                src={defaultImage}
                alt="Default Place 3"
                style={{ width: "200px", height: "150px" }}
              />
              <p>Description of the place 3</p>
            </div>
          </Popup>
        )}

        {/* Fourth custom marker with black color */}
        <Marker longitude={78.48918219999996} latitude={12.2381136}>
          <div
            className="marker"
            style={{
              backgroundColor: "black",
              width: "20px",
              height: "20px",
              borderRadius: "50%",
            }}
          />
        </Marker>
        {/* Fourth default popup */}
        {defaultPopup4 && (
          <Popup
            longitude={78.48918219999996}
            latitude={12.2381136}
            onClose={() => setDefaultPopup4(false)}
          >
            <div>
              <img
                src={defaultImage}
                alt="Default Place 4"
                style={{ width: "200px", height: "150px" }}
              />
              <p>Description of the place 4</p>
            </div>
          </Popup>
        )}

        {/* Fifth custom marker with black color */}
        <Marker longitude={80.48918219999996} latitude={10.7381136}>
          <div
            className="marker"
            style={{
              backgroundColor: "black",
              width: "20px",
              height: "20px",
              borderRadius: "50%",
            }}
          />
        </Marker>
        {/* Fifth default popup */}
        {defaultPopup5 && (
          <Popup
            longitude={80.48918219999996}
            latitude={10.7381136}
            onClose={() => setDefaultPopup5(false)}
          >
            <div>
              <img
                src={defaultImage}
                alt="Default Place 5"
                style={{ width: "200px", height: "150px" }}
              />
              <p>Description of the place 5</p>
            </div>
          </Popup>
        )}

        {/* Selected place popup */}
        {selectedPlace && (
          <Popup
            longitude={selectedPlace.longitude}
            latitude={selectedPlace.latitude}
            onClose={() => setSelectedPlace(null)}
          >
            <div>
              <img
                src={selectedPlace.image}
                alt="Selected Place"
                style={{ width: "200px", height: "150px" }}
              />
              <p>{selectedPlace.description}</p>
            </div>
          </Popup>
        )}
      </Map>
    </div>
  );
}

export default App;
